import React from "react";
import { useEffect, useState } from "react";
import axios from "axios";
//import userlist from ./userlist

const GetUserDetails = (username) => {
    const [userDetails, setUserDetails] = useState('');//useState('');

    React.useEffect(() => {
        //axios.get("http://localhost.5000/userlist").then((response) => {
        const fetchUserDetails = async () => {
            axios.get("http://127.0.0.1:5000/userlist/{username}").then((response) => {
            console.log(response.data);
            setUserDetails(response.data)
        })
    }
    });

    return(
    <div>
    <ul>
        {userDetails.map(item=> {
            return(
            <div>
                <li>email {JSON.stringify(item.email)}</li>
                <li>organization {JSON.stringify(item.organization)}</li>
            </div>
            )
        })}
    </ul>
    </div>
    );
}

const UserDetails = (username) => {
    const [displayInfo, setDisplayInfo] = useState(null);//useState('');

    const handleClick = (id) => {
        setDisplayInfo(id)
    };

    return(
    <div>
        <button onClick={() => handleClick(username)}>{JSON.stringify(username)} details</button>
        <p>{displayInfo}</p>
        {displayInfo && <GetUserDetails username={displayInfo}/>}
    </div>
    );
    //return <button>not clicked</button>;
}

const Userlist = () => {

    const [Users, setUsers] = useState([]);

    React.useEffect(() => {
    //axios.get("http://localhost.5000/userlist").then((response) => {
    axios.get("http://127.0.0.1:5000/userlist").then((response) => {
        console.log(response.data);
        setUsers(response.data);
    });
    });

    return(
        <div>
        <ul>
            {Users.map(item=> {
                return(
                    <li key={item.id}>
                    <ul>
                        <li>
                            <UserDetails username={JSON.stringify(item.username)}/>
                        </li>
                    </ul>
                    </li>
                );
            })}
        </ul>
        </div>
    );
};

//<li>Password: {item.password}</li>
                        //<li>Email: {item.email}</li>
                        //<li>Organization: {item.organization}</li>
                        //<li>Address: {item.address}</li>
                        //<li>City: {item.city}</li>
                        //<li>State: {item.state}</li>
                        //<li>Country: {item.country}</li>
                        //<li>Postalcode: {item.postalcode}</li>

const App = () => {
    return(
        <div>
        <Userlist/>
        </div>
    );
};

export default App;
